import React from "react";
import { Menu } from "antd";

const headerStyle = {
  display: "flex",
  alignItems: "center",
  justifyContent: "space-between",
  padding: "0 24px",
  height: "64px",
  backgroundColor: "#000",
  color: "#fff",
};

const logoStyle = {
  fontSize: "1.5rem",
  fontWeight: "bold",
  color: "#fff",
};

const Header = () => {
  return (
    <header style={headerStyle}>
      {/* 로고 */}
      <div style={logoStyle}>MyLogo</div>

      {/* 메뉴 */}
      <Menu
        theme="dark"
        mode="horizontal"
        items={[
          { key: "1", label: "Home" },
          { key: "2", label: "About" },
          { key: "3", label: "Contact" },
        ]}
        style={{ backgroundColor: "transparent" }} // 헤더 색상에 맞춤
      />
    </header>
  );
};

export default Header;
